  [],\n\t\"revision_timestamp\": \"2016-02-26T18:50:51.327066\",\n\t\"name\": \"nist-test-personal-identity-verification-piv-cards-special-database-33\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The set of NIST Test PIV Cards contains
  sixteen smart cards that are loaded with a PIV Card Application, as specified in
  NIST Special Publication 800-73-3. The PIV Card Applications on the smart cards
  are loaded with test data and keys that are similar to what might appear on actual
  PIV Cards, with the exception that the certificates on the test PIV Cards were issued
  from a test public key infrastructure.The set of test cards includes not only examples
  that are similar to cards issued today, but also examples of cards with features
  that are expected to appear in cards that will be issued in the future. For example,
  while the certificates and data objects on most, if not all, cards issued today
  are signed using RSA PKCS #1 v1.5, the set of test cards include examples of certificates
  and data objects that are signed using each of the algorithms and key sizes listed
  in Table 3-3 of Special Publication 800-78-3, including RSASSA-PSS and ECDSA. Similarly,
  the infrastructure supporting the test cards provides examples of CRLs and OCSP
  responses that are signed using each of these signature algorithms. The set of test
  cards also includes certificates with elliptic curve subject public keys in addition
  to RSA subject public keys, as is permitted by Table 3-1 of Special Publication
  800-78-3. The set of test cards, collectively, also include all of the mandatory
  and optional data objects listed in Section 3 of SP 800-73-3 Part 1, except for
  Cardholder Iris Images. Several of the cards include a Key History object along
  with retired key management keys.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
